function add(a,b){
    let c=a+b;
    return c;
}
function sub(a,b){
    let c=a-b;
    return c;
}
function multiply(a,b){
    let c=a*b;
    return c;
}
function divide(a,b){
    let c=a/b;
    return c;
}

export {add,sub,multiply,divide};
